import './App.css';
import axios from 'axios';
import {useEffect, useState} from 'react';
function App() {
  const [ListofStudents, setListofStudents] = useState([]);
  useEffect(() => {
    axios.get("http://localhost:9192/student").then((response)=>{
      // console.log(response.data);
      setListofStudents(response.data);
    });
  }, []);

  return (
    <div className="App">
      {ListofStudents.map((value, key)=>{
        return (
        <>  
          <div className="title"> {value.name} </div>
          <div className="body">{value.email}</div>
          <div className="footer">{value.phone}</div>
          <div className="footer">{value.address}</div>
          </>
        );
      })}
    </div>
  );
}

export default App;
